import React from 'react';
import  ReactDOM  from 'react-dom';


const Table = ()=> {
    return (
        <ul>
        <li>Пункт 1</li>
        <li>Пункт 2</li>
        <li>Пункт 3</li>
        <li>Пункт 4</li>  
        </ul>
    );
};

const AppHeader= () => {
    return <h1>Data Table</h1>;
};

const SearchPanel= ()=>
{
    return <input placeholder="Search"/>;
};

const App = ()=>{
    <div>
    <AppHeader/>
    <SearchPanel/>
    <Table/>    
    </div>
}


ReactDOM.render(<App/>, document.getElementById('root'));
